const AddToList = () => {
  return <div className="addto-list">
      <input type="text" placeholder="Name" className="addto-list-input" />
      <input type="text" placeholder="Age" className="addto-list-input" />
      <input type="text" placeholder="Image URL" className="addto-list-input" />
      <textarea placeholder="Notes"></textarea>
      AddToList
      </div>;
};

export default AddToList;
